def b64_to_pic(b64: str, dir, file_name):
    ext = 'jpg'
    if b64.startswith('data'):
        ext_start_index = b64.index('/') + 1
        ext_end_index = b64.index(';')
        ext = b64[ext_start_index: ext_end_index]

        data = b64[b64.index(',') + 1:]
        bin_pic = base64.b64decode(data)
    else:
        bin_pic = base64.b64decode(b64)
    with open(dir + file_name + '.' + ext, 'wb') as f:
        f.write(bin_pic)


if __name__ == '__main__':
    b64_to_pic(b64, 'file')
